import SearchBar from "./SearchBar";

const Home = ({ handleSubmit }) => {
	return (
		<div className="home">
			<SearchBar handleSubmit={handleSubmit} />

			<article>
				<div>Traffic Cam</div>
				<div>ERP rates</div>
			</article>
		</div>
	);
};

export default Home;
